const columns = ["Defect Type", "Defect ID", "Timestamp", "Production Line"];

const data = [
 ["POCK", "1234", "Yonkers", "NY"],
 ["SSCT", "", "Hartford", "CT"],
 ["STAN", "Test Corp", "Tampa", "FL"],
 ["POGR", "Test Corp", "Dallas", "TX"],

];

const options = {
  filterType: 'checkbox',
  selectableRows: false
};

function DataTable(){

return(
    <>
<MUIDataTable
  title={"Defect List"}
  data={data}
  columns={columns}
  options={options}
/>
    </>
);
}

export default DataTable;
